import React from 'react';
import styles from './Footer.module.css';
import discountImage from '../../Components/images/discount.jpg'; // Asegúrate de que la ruta sea correcta

const Footer: React.FC = () => {
  return (
    <footer className={styles.footer}>
      <div className={styles.discountContainer}>
        <img src={discountImage} alt="Descuento en servicios" className={styles.discountImage} />
        <p className={styles.discountText}>
          ¡Obtén un 15% de descuento en tu próxima visita pagando en efectivo!
        </p>
      </div>
      <p className={styles.copyright}>
        &copy; {new Date().getFullYear()} Uñas Estéticas. Todos los derechos reservados.
      </p>
    </footer>
  );
};

export default Footer;
